import "./Projects.css";
import React from "react";
// @ts-ignore
import Zoom from "react-reveal/Zoom";
import Carousel from "react-bootstrap/Carousel";
import RIDSI1 from "../../assets/WelcomePicture3.png";

const Projects: React.FC = () => {
  return (
    <div className="body">
      <div className="project-head-parallax">
        <Zoom>
          <Carousel>
            <Carousel.Item>
              <Carousel controls={false}>
                <Carousel.Item interval={3000}>
                  <img
                    className="center welcome-pic-wide rounded"
                    alt="RIDSI1"
                    src={RIDSI1}
                  />
                </Carousel.Item>
                <Carousel.Item interval={3000}>
                  <img
                    className="center welcome-pic-wide rounded"
                    alt="RIDSI1"
                    src={RIDSI1}
                  />
                </Carousel.Item>
              </Carousel>
              <div className="content rounded">
                <p>RIDSI RIDSI RIDSI YEAH YEAH YEAH</p>
                <button>More Details</button>
              </div>
            </Carousel.Item>
          </Carousel>
        </Zoom>
      </div>
      <div className="project-head-regular-wrapper">
        <div className="content rounded">
          <p>
            Lorem ipsum dolor sit amet, consectetur adipiscing elit. .... ....
            Donec in justo eu ligula semper consequat sed a risus.
          </p>
        </div>
      </div>
    </div>
  );
};

export default Projects;
